import React, { Component } from "react";
import "./assignments.scss";
import Assignmentbox from "./assignmentbox/assignmentbox";

const Assignments = () => {
  return (
    <section>
      <div className="assignments">
        <h1>Assignments</h1>
        <div className="assignmentboxes">
          <Assignmentbox assignment={"Assignment 1" + "Passed"}/>
          <Assignmentbox assignment={"Assignment 2" + "Not Passed"}/>
          <Assignmentbox assignment={"Assignment 3" + "Submitted"}/>
          <Assignmentbox assignment={"Assignment 4" +  "Not Submitted"}/>
      </div>
      </div>

      <div className="quizes">
          <h1>Quiz and Tests</h1>
          <div className="quizboxes">
          <Assignmentbox assignment={"Quiz 1"}/>
          <Assignmentbox assignment={"Test 1"}/>
          <Assignmentbox assignment={"Test 2"}/>
      </div>
      </div>
    </section>
  );
};

export default Assignments;
